import Foundation

@objc class WMScriptInterface: NSObject {
    var url: URL?
    static let shared = WMScriptInterface()

    override private init() {}

    override func copy() -> Any {
        return self
    }

    override func mutableCopy() -> Any {
        return self
    }

    @objc func _hello() -> String {
        return "hello wmctcf!"
    }
    
    @objc func _getFlag() -> String {
        if _checkIfIsAllowed() {
            do {
                let flag = try NSString(contentsOfFile: Bundle.main.path(forResource: "flag", ofType: "")!, encoding: String.Encoding.utf8.rawValue)
                return flag as String

            } catch {
                print("chess error ï¼š \(error)")
                return ""
            }
        } else {
            return ""
        }
    }

    func regulayExpression(regularExpress: String, validateString: String) -> [String] {
        do {
            let regex = try NSRegularExpression(pattern: regularExpress, options: [])
            let matches = regex.matches(in: validateString, options: [], range: NSRange(location: 0, length: validateString.count))
            var res: [String] = []
            for item in matches {
                let str = (validateString as NSString).substring(with: item.range)
                res.append(str)
            }
            return res
        } catch {
            return []
        }
    }

    func _checkIfIsAllowed() -> Bool {
        let urlstr = url?.absoluteString

//        print("_checkIfIsAllowed -> \(String(describing: urlstr))")

        let digitRegular = "^data:"
        let diRes = regulayExpression(regularExpress: digitRegular, validateString: urlstr ?? "")

        if diRes == [] {
            return false
        } else {
            return true
        }
    }

    @objc class func isSelectorExcluded(fromWebScript selector: Selector!) -> Bool {
        return false
    }

    @objc class func isKeyExcluded(fromWebScript name: UnsafePointer<CChar>!) -> Bool {
        return false
    }

    @objc class func webScriptName(for selector: Selector!) -> String! {
        return ""
    }

    @objc func invokeUndefinedMethod(fromWebScript name: String!, withArguments arguments: [Any]!) -> Any! {
        print("invokeUndefinedMethod name -> \(String(describing: name))")
        for arg in arguments {
            print("invokeUndefinedMethod arguments -> \(arg)")
        }
        return "data:image/jpeg;base64,"
    }
}
